// NotFound.js
import React from 'react';

const NotFound = () => {
    return (
        <section className='not-found'>
            <div className='container'>
                <div className='inner-flex'>
                    <h3>404 - Page Not Found</h3>
                    <p>The page you are looking for does not exist.</p>
                </div>
            </div>
        </section>
    );
}

export default NotFound;
